import React from 'react';


const Timeline = props => {
    
    let posts = props.posts.map( post => {
        return (
            <div>
            <p> {post.postDate } </p>
            <p> {post.title } </p>
            <p> { post.name } </p>
            <p> { post.content } </p>
            </div>
        )
    })

    return posts;
}
    
 export default Timeline;
